import { useEffect, useState } from "react";

export const Fetch = (url) => {
  const [data, setData] = useState(null);
  useEffect(() => {
    fetch(url)
      .then((response) => response.json())
      .then(
        (responseJson) => setData(responseJson)
        // jsonData is parsed json object received from url
      );
  }, [url]);
  return data;
};
